  \"2016-03-17T07:00:56.159814\",\n\t\"name\": \"vendor-payments-purchase-order-summary-e68d7\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The San Francisco Controller's Office maintains
  a database of payments made to vendors from fiscal year 2007 forward. This data
  is presented on the Vendor Payments report hosted at http://openbook.sfgov.org,
  and is also available in this dataset in CSV format, which represents summary data
  by purchase order. We have removed sensitive information from this data u2013 this
  is intended to show payments made to entities providing goods and services to the
  City and County and to protect individuals. For example, we have removed payments
  to employees (reimbursements, garnishments) and jury members, revenue refunds, payments
  for judgments and claims, witnesses, relocation and rehousing, and a variety of
  human services payments. New data is added on a weekly basis.\",\n\t\"license_title\":
